### Instruction:
In javascript output the values in a dictionary sorted by key alphabetically.

### Response:

let dict = { "apple": 1, "banana": 2, "orange": 3 };
dict = Object.entries(dict).sort((a, b) => a[0].localeCompare(b[0])); // Outputs {"apple": 1, "banana": 2, "orange": 3}
